import { Link } from "react-router-dom";
import style from "../Start/Start.module.css";

export const Start = () => {
  return (
    <div className={style.contenedor}>
      <h1>Este Es Inicio</h1>
      <Link to="Home">
        <button>Star</button>
      </Link>
    </div>
  );
};
